INSERT INTO `pelicula` (`id`, `titulo`, `duracion`, `descripcion`, `edadminima`, `director`, `horaFuncion`, `precioEntrada`, `imagen`) VALUES
(9, 'Dumbo', '120 Minutos', 'El dueño de un circo \nen aprietos contrata a un hombre \ny sus dos hijos para cuidar \nde un elefante recién nacido \nque puede volar, que pronto \nse convierte en la atracción \nprincipal que revitaliza al circo.', 8, 'Tim Burton', '08:30:00', 15000, ),
(12, 'La Maldición de la Llorona', '100 Minutos', 'Los Ángeles, década de 1970. \nUn legendario fantasma \nque se oculta en la oscuridad \nde la noche aterra a los niños. \nTras ignorar espeluzantes \nadvertencias, una trabajadora \nsocial y sus hijos se adentran \nen un mundo sobrenatural \nrepleto de misterio.', 14, 'Michael Chaves', '10:00:00', 9500, );
INSERT INTO `pelicula` (`id`, `titulo`, `duracion`, `descripcion`, `edadminima`, `director`, `horaFuncion`, `precioEntrada`, `imagen`) VALUES
(13, 'Avengers EndGame', '110 Minutos', 'El grave desenlace de los \r\nacontecimientos provocados \r\npor Thanos, que acabó con \r\nla mitad del universo y \r\nparte de Los Vengadores, \r\nobliga a aquellos \r\nSúper Héroes que sobrevivieron \r\na tomar una firme posición \r\nen AVENGERS: ENDGAME. \r\nLa nueva película de \r\nMarvel Studios marca el \r\ngran cierre de un recorrido \r\ncinematográfico sin precedentes.\r\n\r\n\r\n\r\n', 14, 'Anthony Russo, Joe Russo', '12:30:00', 6000, );
INSERT INTO `pelicula` (`id`, `titulo`, `duracion`, `descripcion`, `edadminima`, `director`, `horaFuncion`, `precioEntrada`, `imagen`) VALUES
(14, 'Shazam', '100 Minutos', 'Todos llevamos un superhéroe \r\ndentro, solo se necesita \r\nun poco de magia para \r\nsacarlo a la luz. Cuando \r\nBilly Batson (Angel), \r\nun niño de acogida de \r\n14 años que ha crecido \r\nen las calles, grita \r\nla palabra \'SHAZAM!\' \r\nse convierte en el \r\nSuperhéroe adulto Shazam (Levi), \r\npor cortesía de un \r\nantiguo mago. Dentro \r\nde un cuerpo musculoso \r\ny divino, Shazam esconde \r\nun corazón de niño.\r\n', 10, 'David Sandberg', '14:00:00', 12000, );
INSERT INTO `pelicula` (`id`, `titulo`, `duracion`, `descripcion`, `edadminima`, `director`, `horaFuncion`, `precioEntrada`, `imagen`) VALUES
(15, 'HellBoy', '95 Minutos', 'Hellboy ? es una película estadounidense \ndel genero de superhéroes \nbasada en el personaje de \ncómics Hellboy, dirigida por \nNeil Marshall, con guion \nde Mike Mignola, Andrew Cosby, \nChristopher Golden y \nAron Coleite.', 15, 'Neil Marshall', '17:30:00', 5000, );
INSERT INTO `pelicula` (`id`, `titulo`, `duracion`, `descripcion`, `edadminima`, `director`, `horaFuncion`, `precioEntrada`, `imagen`) VALUES
(16, 'Capitana Marvel', '99 Minutos', 'Una guerrera extraterrestre \nde la civilización Kree \nse encuentra atrapada \nen medio de una batalla. \nCon la ayuda de Nick Fury \ntrata de descubrir los secretos \nde su pasado mientras \naprovecha sus poderes \npara terminar la guerra.', 12, 'Anna Boden, Ryan Fleck', '19:20:00', 8000, );
INSERT INTO `pelicula` (`id`, `titulo`, `duracion`, `descripcion`, `edadminima`, `director`, `horaFuncion`, `precioEntrada`, `imagen`) VALUES
(17, 'Parque Magico', '110 Minutos', 'June es una chica imaginativa \nque se encuentra en el País \nde las Maravillas, un parque \nde diversiones que creó \nen su mente. \nCon el parque en desorden, \nse une a un grupo \nde animales para intentar \nsalvar el lugar antes \nde que se pierda para siempre. \n\n', 6, 'David Feiss', '21:00:00', 7500, );
